postcontent:
Please get involved with the fight against new firearm, magazine, and ammunition laws, there are plenty of them already introduced and more on the way... If you don't take control of the government, it will control you!

Please contact your representatives and let them know you are against any new restrictions that infringe upon our 2nd amendment rights. Remember to be respectful and polite, we don't want turn any friends into foes on this issue. You can copy and paste the email list provided below into your emails "TO" or "ADDRESS" field, which will allow you to reach ALL of the state representatives in one simple e-mailing. Feel free to pass this along to anyone who supports our 2nd Amendment freedom that allows us to hunt, target shoot, and protect our homes and loved ones.

Below the list of bills, there is a link (Popvox) that allows you to send an e-letter to the U.S. Senators and Congressmen in your district that will let them know if you support or oppose the specific bill that has been introduced. Popvox also has a poll for each bill so you can see what others think of the legislation. You will need to know the bills number or part of the title to search for it on Popvox, i.e. "S.150" will bring up the AWB introduced by Feinstein. Here are some other bill numbers to keep an eye on: 

S. 174 The Ammunition Background Check Act
S. 22: The Gun Show Background Check
S. 35: The Stop Online Ammunition Sales Act 
S. 150: The Assault Weapons Ban
S. 33: The High Capacity Ammunition Feeding Device Act
H.R. 117: The Handgun Licensing and Registration Act
H.R. 142: The Stop Online Ammunition Sales Act 
H.R. 437: The Assault Weapons Ban

This is just a taste of what has been introduced...there are many, many more that need to be defeated.

https://www.popvox.com/home


Here is a link to track the progress of any bill introduced, and it's likelihood of passing.

http://www.govtrack.us/congress/bills/browse


Here is the NRA link that allows you to reach your representatives:

http://www.nraila.org/get-involved-l...your-reps.aspx


Here is Ruger's link that allows you to reach your representatives:

http://www.ruger.com/micros/advocacy/takeAction.html


